import React from 'react'

function Newsletter() {
  return (
    <div className='w-full  h-[400px]  bg-[#F1F8FF] mx-30'>
        <div className='justify-centre align-middle font-bold py-6'></div>
        <h1 className='text-4xl py-6 mx-70 my-3'  style={{
        textAlign: "center"
      }}>Subscribe to Newsletter</h1>
      <h1 className='text-xl  mx-70 my-3'  style={{
        textAlign: "center"
      }}>Enter your email address to register to our newsletter subscription!</h1>
      <div className='flex flex-col sm:flex-row items-center justify-between w-[1000px] mx-5'>
            <input
              className='p-3 flex w-full rounded-md text-black'
              type='email'
              placeholder='Enter Email'
            />
            <button className='bg-[#1D5ADE] text-white rounded-full font-medium w-[150px]  m-3 my-7 px-6 py-3'style={{
        textAlign: "center"
      }}>
              Notify Me
            </button>
          </div>

    </div>
  )
}

export default Newsletter
